
import sys

current_limit = sys.getrecursionlimit()
sys.setrecursionlimit(current_limit)

def swap(arr, i, j):
    tmp = arr[i]
    arr[i] = arr[j]
    arr[j] = tmp

def getPivot(arr, left, right):
    i = left
    pivotEl = arr[right]

    for j in range(left, right):
        if arr[j] < pivotEl:
            swap(arr, i, j)
            i+=1
    
    swap(arr, i, right)
    return i

def quickSort(arr, left, right):
    if left < right:
        pivot = getPivot(arr, left, right)
        quickSort(arr, left, pivot-1)
        quickSort(arr, pivot+1, right)
    
def quickSelect(arr, left, right, k):
    if left < right:
        pivot = getPivot(arr, left, right)
        if k == pivot:
            return arr[k]
        elif k > pivot:
            return quickSelect(arr, pivot+1, right, k)
        else:
            return quickSelect(arr, left, pivot-1, k)
        
def kthLargest(nums, k):
    elementIndex = len(nums) - k
    quickSort(nums, 0, len(nums) - 1)
    return nums[elementIndex]

def kthL(nums, k):
    kthsmall = len(nums) - k
    return quickSelect(nums, 0, len(nums) -1 , kthsmall)

